YUI.add("datatable-paginator-templates",function(t,s){var a=new t.Template;t.namespace("DataTable.Templates").Paginator={rowWrapper:a.compile('<tr><td class="<%= this.wrapperClass %>" colspan="<%= this.numOfCols %>"/></tr>'),button:a.compile('<button class="<%= this.classNames.control %> <%= this.classNames.control %>-<%= this.type %>" data-type="<%= this.type %>"><%= this.label %></button>'),content:a.compile("<%= buttons %><%= this.classNames.gotoPage %><%= this.classNames.perPage %>"),buttons:a.compile('<div class="<%= this.classNames.controls %> <%= this.classNames.group %>"><%== this.buttons %></div>'),gotoPage:a.compile('<form action="#" class="<%= this.classNames.group %>"><label><%= this.strings.goToLabel %><input type="text" value="<%= this.page %>"><button><%= this.strings.goToAction %></button></label></form>'),perPage:a.compile('<div class="<%= this.classNames.group %> <%= this.classNames.perPage %>"><label><%= this.strings.perPage %> <select><% Y.Array.each(this.options, function (option, i) { %><option value="<%= option.value %>" <%= option.selected %>><%= option.label %></option><% }); %></select></label></div>')}},"@VERSION@",{requires:["template"]});